// GraphPage.js

import React from 'react';
import GraphVisualizer from './GraphVisualizer';

function GraphPage({
    navigateHome,
    fullPath,
    processedMovies,
    startMovieId,
    endMovieId,
}) {
    return (
        <div>
            <h1>Interactive Movie Graph</h1>
            <button onClick={navigateHome}>Back to Home</button>
            <GraphVisualizer
                fullPath={fullPath}
                processedMovies={processedMovies}
                startMovieId={startMovieId}
                endMovieId={endMovieId}
            />
        </div>
    );
}

export default GraphPage;
